// frontend/src/pages/admin/BranchesManagement.jsx
import React, { useState, useEffect } from 'react';
import authService from '../../services/authService';
import './AdminPages.css';

const BranchesManagement = () => {
  const [branches, setBranches] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [showAddModal, setShowAddModal] = useState(false);
  const [newBranch, setNewBranch] = useState({
    name: '',
    location: 'الرياض',
    working_hours: '{"open": "10:00", "close": "23:00"}',
    contact_info: '{"phone": "", "email": ""}'
  });

  const loadBranches = async () => {
    try {
      setLoading(true);
      setError('');
      
      const response = await authService.getBranches();
      
      if (response.success) {
        setBranches(response.data);
      } else {
        setError(response.error || 'فشل في تحميل الفروع');
      }
    } catch (error) {
      setError('تعذر الاتصال بالخادم');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    loadBranches();
  }, []);

  const handleAddBranch = async () => {
    if (!newBranch.name) {
      alert('اسم الفرع مطلوب');
      return;
    }

    try {
      const response = await authService.createBranch(newBranch);
      
      if (response.success) {
        alert('تم إنشاء الفرع بنجاح');
        setShowAddModal(false);
        setNewBranch({
          name: '',
          location: 'الرياض',
          working_hours: '{"open": "10:00", "close": "23:00"}',
          contact_info: '{"phone": "", "email": ""}'
        });
        loadBranches();
      } else {
        alert(response.error || 'فشل في إنشاء الفرع');
      }
    } catch (error) {
      alert('تعذر الاتصال بالخادم');
    }
  };

  const handleToggleStatus = async (id, currentStatus) => {
    try {
      const response = await authService.updateBranch(id, {
        is_active: !currentStatus
      });
      
      if (response.success) {
        loadBranches();
      } else {
        alert(response.error || 'فشل في تحديث الحالة');
      }
    } catch (error) {
      alert('تعذر الاتصال بالخادم');
    }
  };

  const handleDeleteBranch = async (id) => {
    if (!window.confirm('هل تريد حذف هذا الفرع؟')) return;

    try {
      const response = await authService.deleteBranch(id);
      
      if (response.success) {
        alert('تم حذف الفرع بنجاح');
        loadBranches();
      } else {
        alert(response.error || 'فشل في حذف الفرع');
      }
    } catch (error) {
      alert('تعذر الاتصال بالخادم');
    }
  };

  if (loading) {
    return (
      <div className="loading-container">
        <div className="spinner"></div>
        <p>جاري تحميل الفروع...</p>
      </div>
    );
  }

  return (
    <div className="admin-page">
      <div className="page-header">
        <h1>إدارة الفروع</h1>
        <button 
          className="btn-add"
          onClick={() => setShowAddModal(true)}
        >
          + إضافة فرع جديد
        </button>
      </div>

      {error && (
        <div className="alert alert-error">
          {error}
        </div>
      )}

      <div className="branches-grid">
        {branches.map(branch => (
          <div key={branch.id} className="branch-card">
            <div className="branch-header">
              <h3>{branch.name}</h3>
              <span className={`status-badge ${branch.is_active ? 'active' : 'inactive'}`}>
                {branch.is_active ? 'نشط' : 'غير نشط'}
              </span>
            </div>
            
            <div className="branch-info">
              <div className="info-item">
                <span className="label">الموقع:</span>
                <span className="value">{branch.location || 'غير محدد'}</span>
              </div>
              <div className="info-item">
                <span className="label">أوقات العمل:</span>
                <span className="value">
                  {branch.working_hours ? JSON.parse(branch.working_hours).open + ' - ' + JSON.parse(branch.working_hours).close : 'غير محدد'}
                </span>
              </div>
              <div className="info-item">
                <span className="label">تاريخ الإنشاء:</span>
                <span className="value">
                  {new Date(branch.created_at).toLocaleDateString('ar-SA')}
                </span>
              </div>
            </div>

            <div className="branch-actions">
              <button className="btn-view">عرض التفاصيل</button>
              <button className="btn-edit">تعديل</button>
              <button 
                className={`btn-status ${branch.is_active ? 'deactivate' : 'activate'}`}
                onClick={() => handleToggleStatus(branch.id, branch.is_active)}
              >
                {branch.is_active ? 'إيقاف' : 'تفعيل'}
              </button>
              <button 
                className="btn-delete"
                onClick={() => handleDeleteBranch(branch.id)}
              >
                حذف
              </button>
            </div>
          </div>
        ))}
      </div>

      {/* Modal إضافة فرع */}
      {showAddModal && (
        <div className="modal-overlay">
          <div className="modal">
            <div className="modal-header">
              <h2>إضافة فرع جديد</h2>
              <button 
                className="close-btn"
                onClick={() => setShowAddModal(false)}
              >
                ×
              </button>
            </div>
            <div className="modal-body">
              <div className="form-group">
                <label>اسم الفرع *</label>
                <input
                  type="text"
                  value={newBranch.name}
                  onChange={(e) => setNewBranch({...newBranch, name: e.target.value})}
                  placeholder="أدخل اسم الفرع"
                />
              </div>
              <div className="form-group">
                <label>الموقع</label>
                <input
                  type="text"
                  value={newBranch.location}
                  onChange={(e) => setNewBranch({...newBranch, location: e.target.value})}
                  placeholder="أدخل الموقع"
                />
              </div>
              <div className="form-row">
                <div className="form-group">
                  <label>وقت الفتح</label>
                  <input
                    type="time"
                    defaultValue="10:00"
                    onChange={(e) => {
                      const hours = JSON.parse(newBranch.working_hours || '{}');
                      hours.open = e.target.value;
                      setNewBranch({...newBranch, working_hours: JSON.stringify(hours)});
                    }}
                  />
                </div>
                <div className="form-group">
                  <label>وقت الإغلاق</label>
                  <input
                    type="time"
                    defaultValue="23:00"
                    onChange={(e) => {
                      const hours = JSON.parse(newBranch.working_hours || '{}');
                      hours.close = e.target.value;
                      setNewBranch({...newBranch, working_hours: JSON.stringify(hours)});
                    }}
                  />
                </div>
              </div>
            </div>
            <div className="modal-footer">
              <button 
                className="btn-cancel"
                onClick={() => setShowAddModal(false)}
              >
                إلغاء
              </button>
              <button 
                className="btn-save"
                onClick={handleAddBranch}
              >
                حفظ
              </button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default BranchesManagement;
